  \"2016-07-27T22:42:58.174041\",\n\t\"name\": \"arrowwood-national-wildlife-refuge-narrative-report-september-october-november-decemb-1946\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Arrowwood NWR
  outlines Refuge accomplishments from September through December of 1946. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include grazing, haying, fur harvesting, and timber
  removal. The public relations section of the report describes recreational uses,
  Refuge visitors, and violations. N-R forms and photographs are attached.\",\n\t\"license_title\":
